import { Link } from 'react-router-dom';
import Contact from './Contact';
import React, { Component } from 'react';
import { render } from 'react-dom';
import Modal from 'react-modal';
import SlidingPane from 'react-sliding-pane';
import 'react-sliding-pane/dist/react-sliding-pane.css';


class Documentation extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        isPaneOpen: false,
        isPaneOpenLeft: false
    };
}


   componentDidMount() {
       Modal.setAppElement(this.el);
   }


  render() {
  	return (
          <section className="section section-lg bg-web-desc" id='documentation'>
            <div className="bg-overlay"></div>
            <div className="container">
                <div className="row">
                    <div className="col-lg-12 text-center">
                        <h2 className="text-white">Documentation</h2>
                        <p className="padding-t-15 home-desc">Easy to follow Documentation.</p>
                        <button className="btn btn-bg-white margin-t-30 waves-effect waves-light mb-5">Coming Soon</button>

                    </div>
                </div>
            </div>
            <div className="bg-pattern-effect">
                <img src="images/bg-pattern.png" alt="" />
            </div>
        </section>
  	);
  }
}
export default Documentation;
